"use strict";function Tree(e){this.data=e,this.id=e.id,this.title=e.title,this.startButton=e.startButton,this.questions=e.questions,this.template=TreeTemplates.tree,this.html=this.template(this.data)}function getTreeData(e){return new Promise(function(t,r){var n=new XMLHttpRequest;n.overrideMimeType("application/json"),n.open("GET","http://dev/decision-tree/api/v1/trees/"+e+"/compiled",!0),n.onload=function(){200===n.status?t(n.response):r(Error("Tree could not be loaded:"+n.statusText))},n.onerror=function(){r(Error("There was a network error."))},n.send()})}function createTree(e){getTreeData(e).then(buildTree).catch(handleTreeDataError)}function buildTree(e){var t=JSON.parse(e),r=new Tree(t);Trees.push(r),renderTree(r)}function handleTreeDataError(e){console.log(e)}function renderTree(e){document.getElementById("enp-tree__"+e.id).innerHTML=e.html}var treeJSON={id:"1",title:"Are You Eligible to be a US Citizen",startButton:"Start",questions:[{id:2,content:"Are you at least 18 years old?",options:[{id:3,content:"Yes",destinationID:2},{id:3,content:"No",destinationID:4}]}]},Trees=[];createTree("citizen");